package Pattern;

public class Pattern1 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
int row=5;
int col=5;

  for(int i=0;i<row;i++)   //row
  {
	  for(int j=0;j<col;j++) {   //column
		 System.out.print("*");  
	  }
	  System.out.println();  
  }
	}

}
